import React from 'react';

function Home() {
    return(
        <section>
            <div class="container-fluid">
                <h1 class="mt-5">Welcome</h1>
                <p>Find the topics related to the courses of the 1A and 2A CS catalog in the tab "Courses".</p>
            </div>
        </section>
    );
}

export default Home;
